import QuoteList from "../components/quotes/QuoteList";

const DUMMY_QUOTES = [
  { id: "q1", author: "sachin", text: "Learning React is Fun" },
  { id: "q2", author: "kashyap", text: "Learning React is Great" },
];
const AllQuotes = () => {
  return <QuoteList quotes />;
};

export default AllQuotes;
